import React, {useState, useEffect} from 'react'
import Display from './display'

const Catchdisplay = () => {

    const FetchMoviesHandler = () => {
        useEffect(()=> {
            const fetchMovies = async () => {
               const response =await fetch("http://www.omdbapi.com/?i=tt3896198&apikey=10cf3ef8")
               const responseData = await response.json()

               const loadedMovies = []

               loadedMovies.push({
                   id: responseData.Title
               })



            }
            fetchMovies()
        })
    }

    return(<React.Fragment>
        {loadedMovies.map()}
        <Display /></React.Fragment>)
}

export default Catchdisplay
